INSERT INTO `login_bonus_message_data` VALUES (/*id*/1, /*login_bonus_id*/60000, /*type*/1, /*day_count*/0, /*luck_pattern*/0, /*rate*/1, /*character_id*/190804, /*character_name*/"カリン", /*message*/"新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
