INSERT INTO `login_bonus_message_data` VALUES (/*id*/4, /*login_bonus_id*/60000, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/5, /*login_bonus_id*/60000, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
