INSERT INTO `login_bonus_message_data` VALUES (/*id*/16, /*login_bonus_id*/60000, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
