INSERT INTO `login_bonus_message_data` VALUES (/*id*/92, /*login_bonus_id*/60001, /*type*/1, /*day_count*/0, /*luck_pattern*/0, /*rate*/1, /*character_id*/112101, /*character_name*/"スズメ", /*message*/"新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
