INSERT INTO `login_bonus_message_data` VALUES (/*id*/94, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/95, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/96, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/97, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/98, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/99, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/100, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/101, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
