INSERT INTO `login_bonus_message_data` VALUES (/*id*/109, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
