INSERT INTO `login_bonus_message_data` VALUES (/*id*/111, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/112, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/113, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/114, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/115, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/116, /*login_bonus_id*/60001, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/117, /*login_bonus_id*/60001, /*type*/3, /*day_count*/0, /*luck_pattern*/0, /*rate*/0, /*character_id*/112101, /*character_name*/"スズメ", /*message*/"おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/118, /*login_bonus_id*/60001, /*type*/3, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/112101, /*character_name*/"スズメ", /*message*/"おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/119, /*login_bonus_id*/80003, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"ヒューヒュー♪\nドンドンパフパフー♪", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/120, /*login_bonus_id*/80003, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ひゅーひゅー\nどんどんぱふぱふー\nでございます", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/121, /*login_bonus_id*/80003, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/122, /*login_bonus_id*/80003, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"え？　ちょっと\nいきなりなにっ？", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/123, /*login_bonus_id*/80003, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/124, /*login_bonus_id*/80003, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/125, /*login_bonus_id*/80003, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/126, /*login_bonus_id*/80003, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ですからその日に向けて\n今から気分を盛り上げているのです", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/127, /*login_bonus_id*/80003, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/128, /*login_bonus_id*/80003, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/129, /*login_bonus_id*/80003, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/130, /*login_bonus_id*/80003, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/131, /*login_bonus_id*/80003, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/132, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/133, /*login_bonus_id*/80003, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/134, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"げっ…カリンじゃない\nなんでもないわよ！", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/135, /*login_bonus_id*/80003, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/136, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/137, /*login_bonus_id*/80003, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/138, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/139, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/140, /*login_bonus_id*/80003, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/141, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/142, /*login_bonus_id*/80003, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/143, /*login_bonus_id*/80003, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/144, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/145, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/146, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/147, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/148, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/149, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/150, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"あとは、牧場に素敵な温泉が\n出来たとか…", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/151, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/152, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/153, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えへへ、ありがとうございます\nコッコロちゃん！", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/154, /*login_bonus_id*/80003, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/155, /*login_bonus_id*/80003, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/156, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/157, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/158, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/159, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/160, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/161, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"…積極的？\nなんの話よ？", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/162, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/163, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"ムーサの町で\nきゃるきゃる～ん☆　って！", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/164, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/165, /*login_bonus_id*/80003, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/166, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/167, /*login_bonus_id*/80003, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/168, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/169, /*login_bonus_id*/80003, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/170, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/171, /*login_bonus_id*/80003, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/172, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/173, /*login_bonus_id*/80003, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/174, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/175, /*login_bonus_id*/80003, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/176, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"かくし芸？", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/177, /*login_bonus_id*/80003, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/178, /*login_bonus_id*/80003, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/179, /*login_bonus_id*/80003, /*type*/0, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/180, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/181, /*login_bonus_id*/80003, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/182, /*login_bonus_id*/80003, /*type*/0, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/183, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/184, /*login_bonus_id*/80003, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/185, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", /*voice_id*/26, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/186, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/187, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/188, /*login_bonus_id*/80003, /*type*/0, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/189, /*login_bonus_id*/80003, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/190, /*login_bonus_id*/80003, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/191, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/192, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/193, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", /*voice_id*/32, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/194, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あー\nあー\n…声、これで大丈夫かしら？", /*voice_id*/33, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/195, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", /*voice_id*/34, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/196, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"オイッスー☆", /*voice_id*/35, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/197, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"……\nいや、ないわ\nいつもどおりが一番ね、うん", /*voice_id*/36, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/198, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", /*voice_id*/37, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/199, /*login_bonus_id*/80003, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ど、どど、どうしよう！？\n緊張してきちゃった…！！", /*voice_id*/38, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/200, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/201, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/202, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/203, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/204, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/205, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"オイッスー☆", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/206, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", /*voice_id*/26, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/207, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/208, /*login_bonus_id*/80003, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/209, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"オイッスー☆", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/210, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/211, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あと６日で2.5周年ですか…", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/212, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/213, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/214, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"オイッスー☆", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/215, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", /*voice_id*/26, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/216, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/217, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/218, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/219, /*login_bonus_id*/80003, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/220, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/221, /*login_bonus_id*/80003, /*type*/1, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/222, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", /*voice_id*/32, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/223, /*login_bonus_id*/80003, /*type*/2, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"…………", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/224, /*login_bonus_id*/80003, /*type*/1, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/225, /*login_bonus_id*/80003, /*type*/2, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", /*voice_id*/40, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/226, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", /*voice_id*/33, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/227, /*login_bonus_id*/80003, /*type*/2, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/228, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", /*voice_id*/34, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/229, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", /*voice_id*/35, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/230, /*login_bonus_id*/80003, /*type*/2, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", /*voice_id*/42, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/231, /*login_bonus_id*/80003, /*type*/1, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/232, /*login_bonus_id*/80003, /*type*/2, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", /*voice_id*/43, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/233, /*login_bonus_id*/80003, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", /*voice_id*/36, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/234, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/235, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/236, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/237, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/238, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/239, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"次にコッコロさんですが\nこちらは発声練習をしています", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/240, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/241, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
