INSERT INTO `login_bonus_message_data` VALUES (/*id*/243, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/244, /*login_bonus_id*/80003, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
