INSERT INTO `login_bonus_message_data` VALUES (/*id*/251, /*login_bonus_id*/80003, /*type*/1, /*day_count*/12, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ふふ。お二人とも\n普段通りの様子で\n安心いたしました", /*voice_id*/33, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/252, /*login_bonus_id*/80003, /*type*/2, /*day_count*/12, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/253, /*login_bonus_id*/80003, /*type*/0, /*day_count*/12, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", /*voice_id*/46, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/254, /*login_bonus_id*/80003, /*type*/1, /*day_count*/12, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", /*voice_id*/34, /*additional_type*/0, /*additional_param*/"");
