INSERT INTO `login_bonus_message_data` VALUES (/*id*/256, /*login_bonus_id*/80003, /*type*/0, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/257, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", /*voice_id*/47, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/258, /*login_bonus_id*/80003, /*type*/0, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"忘れてきちゃいました☆", /*voice_id*/42, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/259, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", /*voice_id*/48, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/260, /*login_bonus_id*/80003, /*type*/1, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", /*voice_id*/35, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/261, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", /*voice_id*/49, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/262, /*login_bonus_id*/80003, /*type*/0, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", /*voice_id*/43, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/263, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", /*voice_id*/50, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/264, /*login_bonus_id*/80003, /*type*/1, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", /*voice_id*/36, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/265, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", /*voice_id*/51, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/266, /*login_bonus_id*/80003, /*type*/1, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", /*voice_id*/37, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/267, /*login_bonus_id*/80003, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", /*voice_id*/52, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/268, /*login_bonus_id*/80003, /*type*/0, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", /*voice_id*/44, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/269, /*login_bonus_id*/80003, /*type*/1, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ふふ\nきっと面白い生放送になると\nわたくし、確信しております", /*voice_id*/38, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/270, /*login_bonus_id*/80003, /*type*/0, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", /*voice_id*/45, /*additional_type*/0, /*additional_param*/"");
