INSERT INTO `login_bonus_message_data` VALUES (/*id*/308, /*login_bonus_id*/60002, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
