INSERT INTO `login_bonus_message_data` VALUES (/*id*/324, /*login_bonus_id*/60002, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
