INSERT INTO `login_bonus_message_data` VALUES (/*id*/326, /*login_bonus_id*/60002, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/327, /*login_bonus_id*/60002, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/328, /*login_bonus_id*/60002, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/329, /*login_bonus_id*/60002, /*type*/3, /*day_count*/0, /*luck_pattern*/0, /*rate*/0, /*character_id*/190804, /*character_name*/"カリン", /*message*/"おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/330, /*login_bonus_id*/60002, /*type*/3, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/190804, /*character_name*/"カリン", /*message*/"おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/331, /*login_bonus_id*/80005, /*type*/4, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ささ、シェフィさまはこちらへ…", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/332, /*login_bonus_id*/80005, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"コッコロさん、どこへ行くの…？\n…え？", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/333, /*login_bonus_id*/80005, /*type*/3, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/334, /*login_bonus_id*/80005, /*type*/4, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/335, /*login_bonus_id*/80005, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"ええと…\n二人とも何をしているの？", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/336, /*login_bonus_id*/80005, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/337, /*login_bonus_id*/80005, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"あの日…？", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/338, /*login_bonus_id*/80005, /*type*/3, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/339, /*login_bonus_id*/80005, /*type*/3, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"『プリンセスコネクト！\nRe:Dive』3.5周年！", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/340, /*login_bonus_id*/80005, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"やばいですね☆", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/341, /*login_bonus_id*/80005, /*type*/1, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"って、なにしれっと\n参加してんのよカリン！", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/342, /*login_bonus_id*/80005, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", /*voice_id*/2, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/343, /*login_bonus_id*/80005, /*type*/2, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/344, /*login_bonus_id*/80005, /*type*/3, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/345, /*login_bonus_id*/80005, /*type*/0, /*day_count*/1, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"えっ！？　ええとええと…！\nあ、あと14日…！", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/346, /*login_bonus_id*/80005, /*type*/3, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/347, /*login_bonus_id*/80005, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/348, /*login_bonus_id*/80005, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/349, /*login_bonus_id*/80005, /*type*/3, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/350, /*login_bonus_id*/80005, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"さすがでございます\nペコリーヌさま", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/351, /*login_bonus_id*/80005, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", /*voice_id*/3, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/352, /*login_bonus_id*/80005, /*type*/2, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"しゃなり、しゃなり…\nふふ、案外できるものね", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/353, /*login_bonus_id*/80005, /*type*/3, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/354, /*login_bonus_id*/80005, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"さ、次はキャルさまの\n番でございますよ", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/355, /*login_bonus_id*/80005, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あ、あたしはいいわよ！\nそういうの全然分かんないし…", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/356, /*login_bonus_id*/80005, /*type*/2, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"大丈夫\nやってみると結構楽しいわよ\nほらほらっ", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/357, /*login_bonus_id*/80005, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/358, /*login_bonus_id*/80005, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"いたたた…もぉお～！\nなんであたしがこんな目に～！", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/359, /*login_bonus_id*/80005, /*type*/1, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/360, /*login_bonus_id*/80005, /*type*/0, /*day_count*/2, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/361, /*login_bonus_id*/80005, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/362, /*login_bonus_id*/80005, /*type*/3, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/363, /*login_bonus_id*/80005, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/364, /*login_bonus_id*/80005, /*type*/2, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"聖学祭…って、なにかしら？", /*voice_id*/7, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/365, /*login_bonus_id*/80005, /*type*/1, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/366, /*login_bonus_id*/80005, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/367, /*login_bonus_id*/80005, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/368, /*login_bonus_id*/80005, /*type*/3, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"なかよし部…\n仲が良さそうな名前で\nやばいですね☆", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/369, /*login_bonus_id*/80005, /*type*/0, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"いや、そのまんますぎでしょ…", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/370, /*login_bonus_id*/80005, /*type*/2, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", /*voice_id*/8, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/371, /*login_bonus_id*/80005, /*type*/3, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/372, /*login_bonus_id*/80005, /*type*/2, /*day_count*/3, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"えっ？　ええ…\nぎゅーっ…？", /*voice_id*/9, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/373, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/374, /*login_bonus_id*/80005, /*type*/2, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/375, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/376, /*login_bonus_id*/80005, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/377, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/378, /*login_bonus_id*/80005, /*type*/3, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/379, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/380, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/381, /*login_bonus_id*/80005, /*type*/2, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", /*voice_id*/11, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/382, /*login_bonus_id*/80005, /*type*/3, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/383, /*login_bonus_id*/80005, /*type*/1, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/384, /*login_bonus_id*/80005, /*type*/0, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/385, /*login_bonus_id*/80005, /*type*/2, /*day_count*/4, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", /*voice_id*/12, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/386, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/387, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/388, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/389, /*login_bonus_id*/80005, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/390, /*login_bonus_id*/80005, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/391, /*login_bonus_id*/80005, /*type*/2, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/392, /*login_bonus_id*/80005, /*type*/1, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/393, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/394, /*login_bonus_id*/80005, /*type*/0, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/395, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/396, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/397, /*login_bonus_id*/80005, /*type*/3, /*day_count*/5, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/398, /*login_bonus_id*/80005, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", /*voice_id*/4, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/399, /*login_bonus_id*/80005, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", /*voice_id*/5, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/400, /*login_bonus_id*/80005, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"…えっ！？", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/401, /*login_bonus_id*/80005, /*type*/3, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/402, /*login_bonus_id*/80005, /*type*/0, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/403, /*login_bonus_id*/80005, /*type*/4, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/404, /*login_bonus_id*/80005, /*type*/0, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/405, /*login_bonus_id*/80005, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/406, /*login_bonus_id*/80005, /*type*/3, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/407, /*login_bonus_id*/80005, /*type*/1, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ぶっ殺すぞ！？", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/408, /*login_bonus_id*/80005, /*type*/2, /*day_count*/6, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", /*voice_id*/6, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/409, /*login_bonus_id*/80005, /*type*/1, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/410, /*login_bonus_id*/80005, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/411, /*login_bonus_id*/80005, /*type*/2, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/412, /*login_bonus_id*/80005, /*type*/3, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/413, /*login_bonus_id*/80005, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/414, /*login_bonus_id*/80005, /*type*/2, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/415, /*login_bonus_id*/80005, /*type*/1, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", /*voice_id*/16, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/416, /*login_bonus_id*/80005, /*type*/2, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/417, /*login_bonus_id*/80005, /*type*/1, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"もちろんでございます\n仲良くお勉強いたしましょう", /*voice_id*/17, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/418, /*login_bonus_id*/80005, /*type*/0, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"しれっと教育ママが\n生まれてる…？", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/419, /*login_bonus_id*/80005, /*type*/3, /*day_count*/7, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
