INSERT INTO `login_bonus_message_data` VALUES (/*id*/421, /*login_bonus_id*/80005, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/422, /*login_bonus_id*/80005, /*type*/2, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"…\nねぇコッコロさん\nキャル、どうしちゃったの？", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/423, /*login_bonus_id*/80005, /*type*/1, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", /*voice_id*/18, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/424, /*login_bonus_id*/80005, /*type*/3, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/425, /*login_bonus_id*/80005, /*type*/2, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", /*voice_id*/20, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/426, /*login_bonus_id*/80005, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/427, /*login_bonus_id*/80005, /*type*/1, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", /*voice_id*/19, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/428, /*login_bonus_id*/80005, /*type*/2, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/429, /*login_bonus_id*/80005, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/430, /*login_bonus_id*/80005, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/431, /*login_bonus_id*/80005, /*type*/3, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/432, /*login_bonus_id*/80005, /*type*/0, /*day_count*/8, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/433, /*login_bonus_id*/80005, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/434, /*login_bonus_id*/80005, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"…えっ？\n生放送の意気込み！？\n突然なに！？", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
