INSERT INTO `login_bonus_message_data` VALUES (/*id*/441, /*login_bonus_id*/80005, /*type*/0, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"ううっ…ひっく…\nママッ…！", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/442, /*login_bonus_id*/80005, /*type*/1, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", /*voice_id*/21, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/443, /*login_bonus_id*/80005, /*type*/1, /*day_count*/9, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", /*voice_id*/22, /*additional_type*/0, /*additional_param*/"");
