INSERT INTO `login_bonus_message_data` VALUES (/*id*/445, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"主さま\n3.5周年まであと５日\nでございます", /*voice_id*/23, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/446, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ですがその前に\n生放送がありますね", /*voice_id*/24, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/447, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"…生放送に向けた\n意気込みでございますか？", /*voice_id*/25, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/448, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", /*voice_id*/26, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/449, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/450, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/451, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/452, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/453, /*login_bonus_id*/80005, /*type*/0, /*day_count*/10, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/454, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"3.5周年まであと４日！\nやばいですね☆", /*voice_id*/26, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/455, /*login_bonus_id*/80005, /*type*/1, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", /*voice_id*/32, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/456, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", /*voice_id*/27, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/457, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", /*voice_id*/28, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/458, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", /*voice_id*/29, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/459, /*login_bonus_id*/80005, /*type*/1, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", /*voice_id*/33, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/460, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", /*voice_id*/30, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/461, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", /*voice_id*/31, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/462, /*login_bonus_id*/80005, /*type*/0, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", /*voice_id*/32, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/463, /*login_bonus_id*/80005, /*type*/1, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"だからあたしはやるなんて一言も…", /*voice_id*/34, /*additional_type*/0, /*additional_param*/"");
