INSERT INTO `login_bonus_message_data` VALUES (/*id*/465, /*login_bonus_id*/80005, /*type*/1, /*day_count*/11, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"聞きなさいっての！！", /*voice_id*/35, /*additional_type*/0, /*additional_param*/"");
