INSERT INTO `login_bonus_message_data` VALUES (/*id*/481, /*login_bonus_id*/80005, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"さすが【美食殿】のママですね！\nそしてキャルさんは…", /*voice_id*/10, /*additional_type*/0, /*additional_param*/"");
