INSERT INTO `login_bonus_message_data` VALUES (/*id*/486, /*login_bonus_id*/80005, /*type*/1, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/487, /*login_bonus_id*/80005, /*type*/4, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", /*voice_id*/35, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/488, /*login_bonus_id*/80005, /*type*/3, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", /*voice_id*/38, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/489, /*login_bonus_id*/80005, /*type*/2, /*day_count*/13, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", /*voice_id*/13, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/490, /*login_bonus_id*/80005, /*type*/2, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", /*voice_id*/38, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/491, /*login_bonus_id*/80005, /*type*/3, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/492, /*login_bonus_id*/80005, /*type*/0, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", /*voice_id*/40, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/493, /*login_bonus_id*/80005, /*type*/1, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", /*voice_id*/36, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/494, /*login_bonus_id*/80005, /*type*/2, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/495, /*login_bonus_id*/80005, /*type*/3, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", /*voice_id*/40, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/496, /*login_bonus_id*/80005, /*type*/1, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", /*voice_id*/37, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/497, /*login_bonus_id*/80005, /*type*/0, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/498, /*login_bonus_id*/80005, /*type*/2, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"へ、へぇ…", /*voice_id*/40, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/499, /*login_bonus_id*/80005, /*type*/3, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/500, /*login_bonus_id*/80005, /*type*/2, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/501, /*login_bonus_id*/80005, /*type*/2, /*day_count*/14, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", /*voice_id*/42, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/502, /*login_bonus_id*/80005, /*type*/3, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", /*voice_id*/42, /*additional_type*/0, /*additional_param*/"");
