INSERT INTO `login_bonus_message_data` VALUES (/*id*/505, /*login_bonus_id*/80005, /*type*/0, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"おめでとうございます！", /*voice_id*/43, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/506, /*login_bonus_id*/80005, /*type*/2, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", /*voice_id*/14, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/507, /*login_bonus_id*/80005, /*type*/2, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/190801, /*character_name*/"カリン", /*message*/"ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", /*voice_id*/15, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/508, /*login_bonus_id*/80005, /*type*/3, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", /*voice_id*/43, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/509, /*login_bonus_id*/80005, /*type*/3, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", /*voice_id*/44, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/510, /*login_bonus_id*/80005, /*type*/1, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", /*voice_id*/43, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/511, /*login_bonus_id*/80005, /*type*/1, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/106001, /*character_name*/"キャル", /*message*/"でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", /*voice_id*/44, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/512, /*login_bonus_id*/80005, /*type*/0, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", /*voice_id*/44, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/513, /*login_bonus_id*/80005, /*type*/0, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/106401, /*character_name*/"シェフィ", /*message*/"最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", /*voice_id*/45, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/514, /*login_bonus_id*/80005, /*type*/4, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", /*voice_id*/39, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/515, /*login_bonus_id*/80005, /*type*/4, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", /*voice_id*/40, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/516, /*login_bonus_id*/80005, /*type*/4, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105901, /*character_name*/"コッコロ", /*message*/"わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", /*voice_id*/41, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/517, /*login_bonus_id*/80005, /*type*/3, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"ペコリーヌ", /*message*/"それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", /*voice_id*/45, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/518, /*login_bonus_id*/80005, /*type*/4, /*day_count*/15, /*luck_pattern*/0, /*rate*/0, /*character_id*/105801, /*character_name*/"みんな", /*message*/"これからも\nよろしくおねがいします！", /*voice_id*/46, /*additional_type*/1, /*additional_param*/"105901,42,106001,45,106401,46,190801,16");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/519, /*login_bonus_id*/60003, /*type*/1, /*day_count*/0, /*luck_pattern*/0, /*rate*/1, /*character_id*/190804, /*character_name*/"カリン", /*message*/"新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", /*voice_id*/1, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/520, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/521, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/522, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/523, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/524, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/1, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/525, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/526, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　ラッキカラーは赤！　　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/527, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/528, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/529, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/2, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/530, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/531, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/532, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/533, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/534, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/535, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/536, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/3, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/537, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/538, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/539, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/540, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/541, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/542, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/1, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
INSERT INTO `login_bonus_message_data` VALUES (/*id*/543, /*login_bonus_id*/60003, /*type*/2, /*day_count*/0, /*luck_pattern*/4, /*rate*/2, /*character_id*/0, /*character_name*/"", /*message*/"今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", /*voice_id*/0, /*additional_type*/0, /*additional_param*/"");
